import React from "react";
import { Link } from "react-router-dom";

const Profile = () => {
    return(
        <div>
            <h1>Messages</h1>
            <form>
                <label>
                    Send message:
                    <input type="text" />
                </label>
            </form>
            <Link to="/posts" className="btn btn-primary">View posts</Link>
        </div>

    );
};


export default Profile;
